import { NavLink } from "react-router-dom";
import { Box, Typography, Button } from "@mui/material";

export const Header = () => {
  return (
    <Box component="header" sx={{ backgroundColor: '#111', py: 2 ,  }}>
      

      {/* Navbar Section */}
      <Box
        className="container"
        sx={{
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          px: 2,
          py: 2,
         
        }}
      >
        {/* Brand Section */}
        <Typography variant="h5" component={NavLink} to="/" sx={{ textDecoration: 'none', color: '#fff' }}>
        Frontend Bootcamp
        </Typography>

        {/* Navigation Links */}
        <Box component="nav">
          <Box
            component="ul"
            sx={{
              display: 'flex',
              listStyle: 'none',
              gap: 3,
              p: 0,
              m: 0,
             
            }}
          >
            <li>
              <Button component={NavLink} to="/" sx={{ color: '#fff' }}>
                Home
              </Button>
            </li>
            <li>
              <Button component={NavLink} to="/about" sx={{ color: '#fff' }}>
                About
              </Button>
            </li>
            <li>
              <Button component={NavLink} to="/movie" sx={{ color: '#fff' }}>
                Movie
              </Button>
            </li>
            <li>
              <Button component={NavLink} to="/contact" sx={{ color: '#fff' }}>
                Contact
              </Button>
            </li>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};
